    attach: function (context) {
      // Attach behavior to elements. - https://www.drupal.org/node/2269515
      $(context).find('.big-nav').once('streamlabsMegaMenu').each(function () {
        var $bigNavLinks = $('.big-nav .header_link');
        var $megaMenus = $('.big-nav .big-nav_mega-menu');
        var $dropDowns = $('.big-nav .big-nav_dropdown');
        // var $tabLinks = $('.big-nav_mega-menu_tabs .tab_link');
        var $tabMenus = $('.big-nav_tab_container .tab-nav');
        var navTarget;

        $('.header').on('mouseenter focusin', function() {
          $('.header').addClass('menu-hover');
        });

        // $('[data-nav="big-nav_products"]').on('mouseenter focusin', function() {
        //   $('#tab_link-engines').addClass('tab_link-active');
        //   $('#tab-nav_engines').addClass('show-tab-menu');
        // });

        $('.big-nav').on('mouseenter focusin', '.header_link', function() {
          $megaMenus.removeClass('show-mega-menu');
          $dropDowns.removeClass('show-mega-menu');
          $bigNavLinks.removeClass('header_link-active');
          $(this).addClass('header_link-active');
          navTarget = '#' + $(this).attr('data-nav');
          $(navTarget).addClass('show-mega-menu');
        });

        $('.header').on('mouseleave focusout', function() {
          $('.show-mega-menu').removeClass('show-mega-menu');
          $bigNavLinks.removeClass('header_link-active');
          $tabMenus.removeClass('show-tab-menu');
          //$tabLinks.removeClass('tab_link-active');
        });

        $('.big-nav_mega-menu_tabs').on('mouseenter focusin', '.tab_link', function() {
          $tabMenus.removeClass('show-tab-menu');
          $tabLinks.removeClass('tab_link-active');
          $(this).addClass('tab_link-active');
          navTarget = '#' + $(this).attr('data-nav');
          $(navTarget).addClass('show-tab-menu');
        });

        $('.small-nav').on('click', '.small-nav_toggle', function() {
          $('body').addClass('small-nav-open');
          $('.header').addClass('menu-open');
        });

        $('.small-nav').on('click', '.small-nav_close', function() {
          $('body').removeClass('small-nav-open');
          $('.header').removeClass('menu-open');
        });
      });
    }
