(function ($, Drupal, drupalSettings) {
  Drupal.behaviors.streamlabsDesign = {
    attach: function (context) {
      // Attach behavior to elements. - https://www.drupal.org/node/2269515
      $(context).find('body').once('streamlabsDesign').each(function () {
        BackgroundCheck.init({
          targets: '.bar-navigation',
          images: '.hero',
          threshold: 60
        });

        var waypoint = new Waypoint({
          element: $('main')[0],
          handler: function(direction) {
            $("body").toggleClass('is-scrolled');
          },
          offset: '-1px' // "main" is ALREADY at top of viewport on load. Delaying activation until scrolling begins.
        });
      });
    }
  };

  Drupal.behaviors.imageGalleryHookUp = {
    attach: function (context) {
      // Attach behavior to elements. - https://www.drupal.org/node/2269515
      $(context).find('.paragraph--type--image-gallery').once('imageGalleryHookUp').each(function () {
        $('.paragraph--type--image-gallery a').attr('data-fancybox', 'gallery').addClass('gallery-link').fancybox();
        // $('.gallery-link');
      });
    }
  };

  Drupal.behaviors.smoothLinkScroll = {
    attach: function (context) {
      // Attach behavior to elements. - https://www.drupal.org/node/2269515
      $(context).find('.smooth-scroll').once('smoothLinkScroll').each(function () {
        $('.smooth-scroll').click(function(e) {
          e.preventDefault();

          var position = $($(this).attr("href")).offset().top - 100;

          $("body, html").animate({
            scrollTop: position
          } /* speed */ );
        });
      });
    }
  };

  /**
   * carousel
   */
  Drupal.behaviors.carousel = {
    attach: function (context) {
      // Attach behavior to elements. - https://www.drupal.org/node/2269515
      $(context).find('.paragraph--type--carousel').once('carousel').each(function () {
        let $container = $(this);
        $container.find('.carousel').slick({
          arrows: true,
          autoplaySpeed: 8000,
          autoplay: true,
          dots: true,
          infinite: true,
          speed: 300,
          slidesToShow: 1,
          adaptiveHeight: true
        });

        $.each($('video'), function (index, el) {
          el.muted = true;
        });

        $container.on('afterChange', function (event, slick) {
          $('.slick-current', this).find('video').trigger('play');
        });

        // On before slide change
        $container.on('beforeChange', function (event, slick, currentSlide, nextSlide) {
          let $carouselUL = $container.find('.carousel-ul');
          $('li', $carouselUL).removeClass('selected');
          let slideData = 'li[data-slide="' + nextSlide + '"]';
          $(slideData, $carouselUL).addClass('selected');
        });
      });
    }
  };

  Drupal.behaviors.tooltip = {
    attach: function (context) {
      // Attach behavior to elements. - https://www.drupal.org/node/2269515
      $(context).find('body').once('tooltip').each(function () {
        $('[data-toggle="tooltip"]').tooltip();
      });
    }
  };

})(jQuery, Drupal);
